import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'
import './App.css';
import Login from './page/auth/Login';
import Home from './page/Home/Home';



function App() {

  return (

    <div className="App">
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/login" element={<Login />} />
    </Routes>
   </div>


  );
}

export default App;
